import React from "react";
import Head from "next/head";
import AppLayout from "../components/AppLayout";

const Profile = () => (
  <AppLayout>
    <Head>
      <title>NTB</title>
    </Head>
    <div>Hello, 내정보</div>
  </AppLayout>
);

export default Profile;
